INSERT INTO `gameresource` VALUES (1,'operamini','operamini.jpg','Opera Mini enables you to take your full Web experience to your phone. Fast: Faster mobile internet as data is compressed before being sent to your phone. Free: Opera Mini is free to download. It is the definitive mobile web browser!','operamini-hifi_alcatel-int-en-gb.jar','operamini-hifi_alcatel-int-en-gb.jad',NULL,1,'2010-09-28 14:03:06','en',0,0,1,100,1,'0');
INSERT INTO `gameresource` VALUES (2,'operamini','operamini_fr.jpg','Opera Mini enables you to take your full Web experience to your phone. Fast: Faster mobile internet as data is compressed before being sent to your phone. Free: Opera Mini is free to download. It is the definitive mobile web browser!','operamini-hifi_alcatel-int-fr.jar','operamini-hifi_alcatel-int-fr.jad',NULL,1,'2010-01-07 02:29:58','fr',0,1,1,100,1,'0');
INSERT INTO `gameresource` VALUES (3,'Link-up','Linkup_fr.gif','Cliquez sur deux pièces d’échecs pour le même modèle, Si deux pièces d’échecs peuvent être utilisées de trios ou moins une ligne droite connecté, les deux connectés sur les deux pièces d’échecs ont été éliminés. Dans la mesure du possible dans les plus brefs délais sera l’éliminer toutes les pièces d’échecs. Pour contester votre intelligence!','Link-Up_128x160.jar','Link-Up_128x160.jad',NULL,10,'2009-10-21 14:37:11','fr',0,0,1,100,1,'0');
INSERT INTO `gameresource` VALUES (4,'Crimsonland','Crimsonland.gif','Un homme ne vaut pas une armée mais il peut devenir un héros. Vous avez pris le risque de visiter cette planète alors que vous sachiez très bien ce qui vous attendait. Il n’y a pas d’issue possible : des hordes de monstres sanguinaires vous entourent. C’est le moment de passer à l’action ! Le chef-d�??uvre d’arcade en 2D qui a ravi des millions de fans dans le monde entier est de retour ! La suite du légendaire Crimsonland vous fera descendre en enfer pour une expédition inoubliable. Vous pouvez gagner des milliers de trophées à moins de ne préférer jouer les victimes. Deux modes de jeu vont vous aider à ériger votre Grande pyramide de monstres trucidés et avec le temps, votre personnage devrait se transformer en machine à tuer. Crimsonland: Mobile Massacre, ce n’est pas un simple un jeu : c’est une véritable piq?re d’adrénaline directement dans votre cerveau !','Crimsonland_French_128x160.jar','Crimsonland_French_128x160.jad',NULL,8,'2009-10-21 14:37:23','fr',0,0,1,100,1,'0');
INSERT INTO `gameresource` VALUES (5,'Balled attaque2','Crimsonland.gif','Ball rush est de retour avec encore plus d’action, encore plus de niveaux, et encore plus de plaisir de jeu ! Ne perdez pas votre temps à casser tous les blocs, vous devez uniquement passer au niveau suivant, puis à celui d’après, et celui d’après...Jusqu’au sommet (le dernier niveau), où vous devez absolument tout casser ! Bonne chance, mais soyez prudent - la vitesse de la balle augmente perpétuellement !','Crimsonland_French_128x160.jar','Crimsonland_French_128x160.jad',NULL,8,'2009-10-21 14:37:34','fr',0,0,1,100,1,'0');
INSERT INTO `gameresource` VALUES (6,'Penguin Fever','PenguinFever_fr.gif','AIDEZ INUK RETOURNER CHEZ LUI.POUSSEZ TOUS LES PINGOUINS SAUF LES GROS. LE ROI DOIT TOMBER EN DERNIER ET ON NE PEUT POUSSER QU’UNE SEULE FOIS PAR NIVEAU. ATTENTION ! LES PINGOUINS N’ONT PAS TOUS LE MME COMPORTEMENT.','PenguinFever-081216.jar','PenguinFever-081216.jad',NULL,11,'2009-10-21 14:37:46','fr',0,0,1,100,1,'0');
INSERT INTO `gameresource` VALUES (7,'Dark King','DarkKing_fr.gif','Dans le jeu l’Equipé de 4 couleurs Médaille de bronze, de cristal, de l’or, l’or noir 4,respectivement, d’indiquer les couleurs vert, bleu, jaune, An Hong 4 couleurs de Equipé Chaque supplément de 5% 10% 20% 50% de la capacité, en particulier.','Night_128x160.jar','Night_128x160.jad',NULL,10,'2009-10-21 14:37:56','fr',0,0,1,100,1,'0');
INSERT INTO `gameresource` VALUES (8,'Dark Age','DarkAge_fr.gif','La tombée de la nuit pendant des années ans avant, dans la Guerre du Human vs la diable mondiale. Spartan --- le swordsman de la diable, Qui tombé dans l’amour avec Une femme humaine.Il a contribué à la victoire de l’homme avec la force de la Sky Sword. Enfin la diable a décro?tre.Après 100 ans. Salman --- un Master de la diable, Qui a dirigé Simon et la puissante armée. Ils sont allés à La Sparta Temple,Ils sont prêts à revenir la force de la Sky Sword--que avait été volé par Sparta. C’est facile à opérer! C’est smooth action! Jouer facilement en particulier!','Dark-Age_128x160.jar','Dark-Age_128x160.jad',NULL,10,'2009-10-21 14:38:04','fr',0,0,1,100,1,'0');
INSERT INTO `gameresource` VALUES (9,'Tangram','Tangram_fr.gif','Présentation du jeu : Tangram est un jeu traditionnel de puzzle chinois. Le puzzle de Tangram comprend un carré, un parallélogramme et des triangles. Même un si petit nombre de formes se combinent en une diversité d’images. Par exemple, les chiffres de 0 à 9, l’alphabet phonétique chinois, des formes géométriques, des animaux et bien d’autres.','Tangrams_FR_20090203.jar','Tangrams_FR_20090203.jad',NULL,9,'2009-10-21 14:38:13','fr',0,0,1,100,1,'0');
INSERT INTO `gameresource` VALUES (10,'TowerWars','TowerWars_fr.gif','A la naissance du temps, l’univers est entré dans un nouveau stade d’existence. Cette nouvelle dimension vint avec de grandes responsabilités et conséquences. Six Gardiens de la destinée furent convoqués pour protéger l’espace temps avant qu’un jour ils aient tous mystérieusement disparu.','TowerWars-081212.jar','TowerWars-081212.jad',NULL,11,'2009-10-21 14:38:29','fr',0,0,1,100,1,'0');
INSERT INTO `gameresource` VALUES (11,'RequinNoir2','Requin_fr.gif','Les terroristes sont des gens comme tout le monde, et ils aiment passer leurs vacances d’hiver dans des stations de ski, comme n’importe qui d’autre. Mais ils ne seraient pas de vrais terroristes sans engins nucléaires ! Cette fois-ci, les ’Enfants de Danava�? ont décidé de joindre l’utile à l’agréable, et Dieu seul sait quelle catastrophe aurait eu lieu si l’hélicoptère militaire le plus puissant de notre siècle, le Black Shark, n’avait pas été là. Black Shark va faire face aux neiges éternelles, à des centaines d’unités d’infanterie surentra?nées, des centaines de milliers de bombes et de fusils, un chasseur supersonique invulnérable, le ’Su-27�?, le sous-marin atomique ’Octobre Rouge�?, les soldes de No?l dans les magasins...sans oublier un invité spécial �? le père No?l et ses rennes ! Ho ho ho !','BlackShark_128x160.jar','BlackShark_128x160.jad',NULL,8,'2009-10-21 14:38:33','fr',0,0,1,100,1,'0');
INSERT INTO `gameresource` VALUES (12,'WinJeux3dans1','WinJeux3dans1_fr.gif','3 en 1 ? Pas mal. Mais trois légendes du jeu sur ordinateur, c’est encore mieux. Retrouvez Spider Solitaire, Free Cell, ainsi que l’indémodable Minesweeper sur votre mobile �? tout simplement fantastique ! Amusez-vous, tuez le temps n’importe où et n’importe quand. Une conception et des graphismes excellents, une multitude de modes de jeu et une bande sonore de qualité viennent s’ajouter à un jeu déjà irréprochable. Minesweeper �? une véritable légende, dans laquelle vous devez trouver les mines, gr?ce aux champs contigus, pour finalement marquer toutes les cellules dangereuses d’un drapeau. Spider �? ce jeu de solitaire implique plusieurs paquets de cartes. Votre but est de réunir toutes les cartes en ordre décroissant. Vous ne pouvez plus bouger ? Utilisez les paquets pour remplir les colonnes. Free Cell solitaire est un jeu bien connu. Classez les cartes de chaque couleur par ordre croissant en vous servant de quatre cellules vides. Minesweeper, Free Cell et Spider �? des classiques à l’ancienne.','wingame3in1_128x160.jar','wingame3in1_128x160.jad',NULL,8,'2009-10-21 13:35:49','fr',0,0,1,100,1,'0');
INSERT INTO `gameresource` VALUES (13,'Parcd attractions','Parcdattractions2_fr.gif','The Arcade Park collection est destinée à relancer la légendaire des jeux du passé, populaires avec des millions d’utilisateurs. La deuxième partie comprend Digger, et Invaders Galaxy Gold Hunter.','ArcadePark2_French_128x160.jar','ArcadePark2_French_128x160.jad',NULL,8,'2009-10-21 14:38:56','fr',0,0,1,100,1,'0');
