INSERT INTO `newsresource` VALUES (1,'Help &amp; Others','== Help ==\r\nDear customer, all services and contents here are provided by Service Providers. If you have any problem when using these services, please contact the customer service of Service Provider or your mobile network operator.\r\n== Fees ==\r\nDear customer, Service Provider will charge the corresponding fees when using certain service, please read through the pricing prompt carefully. Moreover, the GPRS traffic will be charged by local mobile network operator, as to the charge standard, please contact operator for details.\r\n== Contact Us ==\r\nAny question, please email to us:wap.info@tcl.com\r\nOur working hours: 9:00A.M~18:00P.M Monday~Friday, excluding weekend and public holiday.\r\n== Disclaimer ==\r\nThe information contained in this website is for general information purposes only.we do not guarantee the completeness, accuracy, reliability, suitability or availability with respect to the information, products, services, or related graphics contained on the website. we exclude all liability in connection with browsing this Web site, use of information or downloading any materials from it, including but not limited to any liability for errors, inaccuracies, omissions, or misleading or defamatory statements. In no event we will we be liable for any loss or damage including without limitation, indirect or consequential loss or damage.','','en','2009-12-08 02:50:54',1,0,100);
INSERT INTO `newsresource` VALUES (2,'Aide et Autres','=Aide=\r\nCher client, tous les services et contenus sont fournis ici par les fournisseurs de services. Si vous rencontrez un problème lors de l’utilisation de ces services, merci de contacter le service Clients de votre fournisseur de services ou votre opérateur de téléphonie mobile.\r\n=Frais=\r\nCher client, le fournisseur de services facturera les frais correspondant aux services utilisés. Merci de consulter attentivement les tarifs. De plus, la connexion GPRS sera facturée par l’opérateur de téléphonie mobile local. En ce qui concerne les frais standards, merci de contacter l’opérateur local pour les détails.\r\n=Contactez-nous=\r\nPour toute question, merci de nous contacter par e-mail:wap.info@tcl.com\r\nNos horaires d’àouverture : de 9h00 à 18h00, du Lundi au Vendredi, sauf week-end et jours fériés.\r\n=Avertissement=\r\nLes informations contenues dans ce site ne sont données qu’titre indicatif.Nous ne garantissons pas l’exhaustivité, l’exactitude, la fiabilité, la conformité ou la disponibilité des renseignements, produits, services ou graphiques figurant sur le site Internet.Nous déclinons toute responsabilité en ce qui concerne les dommages susceptibles de résulter du téléchargement ou de l’utilisation des informations ou des données disponibles sur le site Internet, y compris, mais de manière non limitative, la responsabilité pour les erreurs, les inexactitudes, les omissions ou les déclarations diffamatoires. Nous ne pourrons en aucun cas être tenus responsables de tout dommage ou perte comprenant, de manière non limitative, les pertes ou dommages-intérêts indirects.','','fr','2009-10-21 10:38:56',1,0,100);
